import React from 'react';
import Header from './Header';
import Home from './Home';
import Products from './Products'
import Footer from './Footer'
import './App.css';

function App() {
  return (
    <div className="App">
      <Header />
      <Home />
      <Products />
      <Footer />
    </div>
  );
}

export default App;
